export default function Cart(props){
    console.log(props.listPanier);
    return(
        <aside className="cart">
            
            <h2>Panier</h2>
            <ul>
                {
                    props.listPanier.map(plant => (
                        <li>{plant.quantity} {plant.plant.name} {plant.plant.price}$</li>
                    ))
                }
            </ul>
            <h2>Total</h2>
            <button>Valider le Panier</button>
        </aside>
    )
}
